import React from 'react'

import '../../globals.css'
import {AppInitialProps} from "next/app";

type Props = {
  Component: React.ReactNode,
  pageProps: AppInitialProps

}

function App({ Component, pageProps }: Props) {
  return <Component {...pageProps} />
}

export default App
